script: |
  super -f text -I q10069.spq | sort > q10069.out

inputs:
  - name: q10069.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE + 57 NOT BETWEEN - col0 - col0 * + - col2 / col0 + - CAST ( 16 AS INTEGER ) AND - 71;
  - name: tab2

outputs:
  - name: q10069.out
    data: |
      46	51	23
      64	77	40
      75	67	58
